import styled from "styled-components";

const StyledHeader = styled.header`
  padding: 20px 0;
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  z-index: 99;
  background-color: #ffffffcd;
`;

export const S = {
  StyledHeader
}
